import logo from "./logo.svg";
import "./App.css";
import { Children, useState } from "react";

function App() {
  const [age, setAge] = useState();
  const [gender, setGender] = useState();
  const [bmi, setBmi] = useState();
  const [children, setChildren] = useState();
  const [isSmoker, setIsSmoker] = useState();
  const [region, setRegion] = useState();
  const [charges, setCharges] = useState();

  return (
    <div className='App'>
      <span className='title' style={{ fontSize: 30 }}>
        Medical Insurance Cost Prediction
      </span>
      <span className='title'>Enter Age:</span>
      <input
        type='number'
        value={age}
        onChange={(e) => setAge(e.target.value)}
        placeholder='30'
      />
      <span className='title'>Gender</span>
      <label htmlFor='gender' className='title'>
        Select Gender:{" "}
      </label>
      <select
        id='gender'
        value={gender}
        onChange={(e) => setGender(e.target.value)}
      >
        <option value=''>--Please choose an option--</option>
        <option value='male'>Male</option>
        <option value='female'>Female</option>
      </select>
      <span className='title'>BMI:</span>
      <input
        type='number'
        value={bmi}
        onChange={(e) => setBmi(e.target.value)}
        placeholder='27.99'
      />
      <label htmlFor='children' className='title'>
        Number of Children:{" "}
      </label>
      <select id='children' value={children} onChange={(e) => e.target.value}>
        <option value=''>--Please choose an option--</option>
        <option value='0'>0</option>
        <option value='1'>1</option>
        <option value='2'>2</option>
        <option value='3'>3</option>
        <option value='4'>4</option>
        <option value='5'>5</option>
      </select>
    </div>
  );
}

export default App;
